import React, { forwardRef, type ComponentProps } from 'react'

type BaseStickerProps = ComponentProps<'svg'>
export type StickerProps = Omit<BaseStickerProps, 'children'>
type StickerComponent<T> = React.FunctionComponent<T & React.RefAttributes<SVGSVGElement>>

export const BaseSticker: StickerComponent<BaseStickerProps> = forwardRef(function BaseSticker(
    { className, ...props }: BaseStickerProps,
    ref
): JSX.Element {
    const customClassName = className ? ` ${className}` : ''
    return (
        <svg
            ref={ref}
            className={'LemonSticker' + customClassName} // We use .LemonSticker for compatibility with existing app Stickers, but this may change
            width="100%"
            fill="currentColor"
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 36 36"
            {...props}
        />
    )
})

